import styled from "styled-components";
import { SPACING } from "./Global Styles/styles";
import SearchBar from "./SearchBar";
import Card from "./Card/Card";

const MainArea = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    margin: 0px 48px 0px 48px;
`;

const SearchBarArea = styled.div`
    margin: ${SPACING.large} 126px ${SPACING.large} 126px;
`;

const CardWrapper = styled.div`
    display: flex;
    flex-wrap: wrap;
    align-items: stretch;
    gap: ${SPACING.base};
`;

const Main = () => {
    return(
        <MainArea>
            <SearchBarArea>
                <SearchBar />
            </SearchBarArea>
            <CardWrapper>
                <Card />
                <Card />
                <Card />
                <Card />
                <Card />

            </CardWrapper>
        </MainArea>
    );
}

export default Main;
